import './Register.css'
import { Link } from 'react-router-dom';
function Register() {
    return (
        <>
        <div className='reg-form'>
            <h1>REGISTER</h1>
                <form >
        
                    
            <i class="fa-solid fa-user"></i><input type="text" placeholder="enter your name" required />
            
               <i class="fa-solid fa-envelope"></i><input type="email" placeholder="enter your email" required />
               <i class="fa-solid fa-lock"></i><input type="password" placeholder="enter your password" required />
               <i class="fa-solid fa-lock"></i><input type="password" placeholder="enter your password" required />
        
                <Link to='/registered' className=" reg-btn">Register</Link>
                <p>Already have an account? <span><Link to='/signup' className='signup-link'>Sign Up</Link></span></p>
            </form>
            </div>
           
            </>
    )
}
export default Register;
